import React from 'react';
import './RestaurantCard.css'; // Importa los estilos del componente RestaurantCard
import { renderStarsAndSoles } from '../../utils/utils';

const RestaurantCard = ({ result, handleResultClick }) => {
  const { name, price, meal_type, star_number, soles_number } = result._source;
  return (
    <div className="restaurantCard" onClick={() => handleResultClick(result)}>
      <h3>{name}</h3>
      <p>{price}</p>
      <p>{meal_type}</p>
      <div>{renderStarsAndSoles(star_number, soles_number)}</div>
    </div>
  );
};

export default RestaurantCard;
